import React, { useState } from "react";
import "./index.css";
import DashtoonRoutes from "./DashtoonRoutes.js";
const Navbar = ({panels}) => {
  const [activeLink, setActiveLink] = useState("");
  // const navClick = () =>{
  //   if()
  // }
  const navClick = (link) =>{
    console.log(link);
    if(link==="comic"){
        if(panels.size===1) alert("You have not generated any comic")
        return;
    }
    window.location.pathname = link;
  }
  return (
    <div className="navWrapper">
      <div className="navLogo">
        Lexi
        <span style={{ color: "#00",padding:"0" }} className="navLogo">
          Comic
        </span>
        raft
      </div>
      <div className="navLinks">
        {DashtoonRoutes.map((route, key) => {
          return (
            <div
              className={
                window.location.pathname === "/" + route.linkTo
                  ? "navLink activeLink"
                  : "navLink"
              }
              // onClick={() => (window.location.pathname = route.linkTo)}
              onClick={() => (window.location.pathname = route.linkTo)}
            >
              {route.name}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Navbar;
